import React from "react";
import classes from './Products.module.css'
import Card from "../../components/product_card/ProductCard";
import { Animator, ScrollContainer, ScrollPage, batch, Fade, FadeIn, FadeOut, Move, MoveIn, MoveOut, Sticky, StickyIn, StickyOut, Zoom, ZoomIn, ZoomOut } from "react-scroll-motion";


let test_card = ["../../../public/images/image13.png", ["Фасад (“Бифлекс” и  “Масло”)", "Размер 200x110 см (разложенный) Три варианта расцветок: белый, коричневый, серый (антрацит)"], '5200']



const Products = () => {
    const Spin = (cycle: number) => 
    ({
        in: {
            style: {
                // `p` is number (0~1)
                // When just before this page appear, `p` will be 0
                // When this page filled your screen, `p` will be 1
                transform: (p) => `rotate(${p * 360 * cycle}deg)`,
            },
        },
        out: {
            style: {
                // `p` is number (0~1)
                // When this page filled your screen, `p` will be 0
                // When just after this page disappear, `p` will be 1
                transform: (p) => `rotate(${p * 360 * cycle}deg)`,
            },
        },
    } as Animation);

    return (
        <div className={classes.page_container}>
            <div className={classes.page_head}>
                <h2 className="products_head" >Наши товары</h2>
            </div>
            <div className={classes.page_content}>
                <ScrollContainer>
                    <ScrollPage>
                        <Animator animation={batch(Sticky(), Fade(), Spin(3))}>
                            <h1 style={{ fontSize: 50 }}>Hello!!!</h1>
                        </Animator>
                    </ScrollPage>
                    <ScrollPage>
                    </ScrollPage>
                </ScrollContainer>
                <Card photo={test_card[0]} info={test_card[1]} price={test_card[2]} />
                <Card photo={test_card[0]} info={test_card[1]} price={test_card[2]} />
                <Card photo={test_card[0]} info={test_card[1]} price={test_card[2]} />
            </div>
        </div>
    );
}

export default Products;
